import React from 'react';
import { BrowserRouter as Router, Route, Switch, Redirect } from 'react-router-dom';
import MyButton from '../components/ExamButton/ExamButton';
import IELTSAcademic from './IELTSAcademic';


const Home = () =>{
    return (
        <Router>
            <Route exact path="/IELTSAcademic"><IELTSAcademic/></Route>
            <button onClick={()=>{<Redirect to='/IELTSAcademic'/>}}>This is a button</button>

            <MyButton name="IELTS General"/>
            <MyButton name="IELTS Academic"/>
            <MyButton name="TOELF IBT"/>
        </Router>
        
    )
}

export default Home;
